                            <p class=""mt-3 text-medium"">Our first date was the next day after that dinner with friends. Being already head over hills in love with Helen, we spend the whole day together. We walked, talked, laughed, cycled over the city…had dinner on the beach…everything was just perfect. We couldn’t let each other go and it was then when I understood she would become my wife one day. - Andrew</p>
